Description:
Hello there! nice to e-meet you! Thanks for clicking on my gig page.

Here's how I can help you **transcribe your video / audio** while making sure it connects to the audience and that every single detail is preserved faithfully.

These are the languages that I've **mastered:**

* **JAPANESE**
* **BRAZILIAN PORTUGUESE**
* **ENGLISH**

Notable Clients:

* **NHK (**Core Kyoto and Train Cruise);
* **Caligrama Editores** (Caligrama Editores" in transcribing and translating 4 animes. "Dragon Quest 2020", "Fate Kaleid", "Full Moon wo Sagashite", Kannazuki no Miko, "The Qwaser of Stigmata", "Haiyore! Nyaruko-san");

Here are the **benefiits** I offer for our cooperation:

1. Transcription of any audio or video (**NSFW OK);**
2. Translating said transcription into any of the languages previously stated;
3. Structuring, and Editing by Netflix standard guidelines;
4. Hardcoding them into your video or audio **(Optional)**;
5. Transcribing and/or subtitling your **Youtube / Instagram / Tik Tok / Vimeo** / **ニコニコ動画** videos!;
